  const [result, setResult] = useState('');
  const api = axios.create({
    baseURL: '/api',
  });
  useEffect(() => {
    api
      .get('/main')
      .then((response) => {
        setResult(response.data);
        console.log(response);
      })
      .catch((error) => {
        setResult(error);
      });
  }, []);
  return (
    <div className={styles['App']}>
      <header className={styles['App-header']}>
